import React from 'react';
import Entry from './Entry';
import Emojipedia from "../emojipedia";

function createEmoji(emoji) {
	return(
		<Entry data={emoji}/>
	)
}

function App() {
	return(
		<div>

			<dl className="dictionary">{Emojipedia.map( createEmoji )}</dl>
		</div>
	)
}

export default App;
